import React, { Component } from 'react';
import Navibar from "../Coponent/Navibar";
import Axios from 'axios';

export default class Orders extends Component {
    constructor(props) {
        super(props)
        this.state = {
            reply:[]
        }
        this.handle_out=this.handle_out.bind(this);
        this.getData=this.getData.bind(this);
    }
    getData(){
        console.log(this.props.user.uid)
        var url="http://127.0.0.1:8081/v2/booking/user?uid="
        url+=this.props.uid.email
        console.log(url)
        Axios.get(url)
            .then(res=>{
                console.log("res:",res.data);
                this.setState({
                    reply:res.data
                })
            });   
    }
    handle_out(){
        this.props.handlelogout()
    }
    render() {
        
        return (
            <div className="order">
                <Navibar loggedinstatus={this.props.loggedinstatus} handle_out={this.handle_out}/>
                <div className="order_container">
                    <button className="order_button" onClick={()=>this.getData()}>
                        your orders
                    </button>
                    <div >
                        {this.state.reply.map((detail,index) => {
                            if(detail.rid===this.props.r.rid){
                                return <div className="s_div">
                                <div>
                                    <h2>Order: </h2>
                                    <p className="di">{index+1}</p>
                                </div>
                                <br />
                                <div>
                                    <h3>Room id: </h3>
                                    <p className="di">{detail.rid}</p>
                                </div>
                                <div>
                                    <h3>Room name: </h3>
                                    <p className="di">{this.props.r.name}</p>
                                </div>
                                <div>
                                    <h3>Room type: </h3>
                                    <p className="di">{this.props.r.type}</p>
                                </div>
                                
                                <div>
                                    <h3>City: </h3>
                                    <p className="di">{this.props.r.city}</p>
                                </div>
                                <div>
                                    <h3>Suburb: </h3>
                                    <p className="di">{this.props.r.suburb}</p>
                                </div>
                                <div>
                                    <h3>Room address: </h3>
                                    <p className="di">{this.props.r.address}</p>
                                </div>
                                <div>
                                    <h3>Check in date: </h3>
                                    <p className="di">{detail.date_start}</p>
                                </div>
                                <div>
                                    <h3>Check out date: </h3>
                                    <p className="di">{detail.date_end}</p>
                                </div>
                                <div>
                                    <h3>price per night: </h3>
                                    <p className="di">{this.props.r.price}</p>
                                </div>
                                <div>
                                    <h3>Total price: </h3>
                                    <p className="di">{this.props.price}</p>
                                </div>

                                
                            </div>
                            }
                            
                        })}

                    </div>
                </div>
            </div>
        );
    }
}
